import React from "react";

const Hobbies = () => {
  return (
    <div className="hobbies">
      <h3>Intérêts</h3>
      <ul>
        <li className="hobby">
          <i className="fas fa-climbing">Escalade</i>
        </li>
        <li className="hobby">
          <i className="fas fa-hiking">Randonnées</i>
        </li>
        <li className="hobby">
          <i className="fas fa-snowboarding">Surf</i>
        </li>
        <li className="hobby">
          <i className="fas fa-seedling">Permaculture</i>
        </li>
        <li className="hobby">
          <i className="fas fa-book">Science-fiction, Fantasy</i>
        </li>
      </ul>
    </div>
  );
};

export default Hobbies;
